function FormatDate(n){var t=n.getMonth()+1,i=n.getDate(),r=n.getFullYear();return t=t<10?"0"+t:t,i=i<10?"0"+i:i,t+"/"+i+"/"+r}function OnCurrencyKeyPress(n){var t=$("#"+n.target.id).data("tTextBox"),i=n.target.value.toString();t.digits=GetDecimalDigits(i)}function GetDecimalDigits(n){var t=String(n).split(".");return t[1]?t[1].length:0}